import React from "react";
import Jumbotron from 'react-bootstrap/Jumbotron'

function Header(){
    return <Jumbotron fluid>
        <container>
            <h1>報名系統</h1>
            <p>靈實員工培訓課程報名系統</p>
        </container>
    </Jumbotron>;
}

export default Header;
